int16_t *readPtr = &noise_pcm_buf[0];
static int get_random_val_q31(void)
{
    /* Linear Congruence method for Pseudo-random number generation
     * X_i+1 = alpa * X_i + c mod m
     * m > 0 - affects periodicity
     * alpha (0, m) - scalar
     * c (0, m) - increment
     */
    static int xi = RANDOMNESS_SEED;
    /* want to limit everything in the range of 0-0.1f. So, 0.1f in Q31 is roughly 27 bits on log2 scale.
     * Hence, modulo factor should be 2^27
     */
    int xi_plus_1 = (FXP_Q31xQ31_MPY(RANDOMNESS_ALPHA, xi, RANDOMNESS_SCALAR) + RANDOMNESS_INCREMENT_C) & 0x7FFFFFF; /* faster way to mod 2^27 */
    xi = xi_plus_1;
    return xi;
}

static inline int get_range_limited_audio(int32_t inputSample, int32_t noiseSample)
{
    int64_t sum = inputSample + noiseSample;
    if (sum >= MAX_SIGNAL_AMP)
    {
        sum = MAX_SIGNAL_AMP;
    }
    else if (sum <= MIN_SIGNAL_AMP)
    {
        sum = MIN_SIGNAL_AMP;
    }
    return (int32_t)sum;
}

void hack_ambient_noise_effect(int *inpBufPtr, int *opBufPtr, unsigned int numSamples)
{
    /* Figure gain and decay. Only restrictions are:
     * gain >> decay
     * gain + decay == 1
     */
    int decay_factor = 327;  /* 32768 is max, so roughly 0.01 */
    int gain_factor  = 32768 - decay_factor; /* 0.95 in Q16.15 format */

    for(unsigned int n = 0; n < numSamples; n++)
    {
        int16_t val = *readPtr;
        if (readPtr == &noise_pcm_buf[(MAX_NUM_SAMPLES_OF_NOISE - 1)])
        {
            readPtr = &noise_pcm_buf[0];
        }
        else
        {
            readPtr++;
        }
        int32_t final_val = ((int32_t)val << 16);
        opBufPtr[n] = FXP_Q31xQ31_MPY(inpBufPtr[n], gain_factor, GAIN_SCALAR) +
                      FXP_Q31xQ31_MPY(final_val, decay_factor, GAIN_SCALAR);
    }
}

void hack_vinyl_crackle_effect(int *inpBufPtr, int *opBufPtr, unsigned int numSamples)
{
    int crackleAmp = -1;
    static int cnt = 0;
    for(unsigned int n = 0; n < numSamples; n++)
    {
        crackleAmp = FXP_Q31xQ31_MPY(get_random_val_q31(), 32, 15);
        int rand = get_random_val_q31();
        if ((rand < RANDOMNESS_APPLICATION_HI_LIM) && (rand > RANDOMNESS_APPLICATION_LO_LIM) && (cnt >= RANDOMNESS_CADENCE_IN_SAMPLES))
        {
            opBufPtr[n] = get_range_limited_audio(inpBufPtr[n], crackleAmp);
            cnt = 0;
        }

        cnt++;
    }
}
